import React from "react";
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';

const List = function ({products}) {
  return fakePlaylists.map(() => (
    <Card style={{ width: '33%' }} key={products[0].id}>
            <Card.Img variant="top" src={products[0].images.url} />
            <Card.Body>
                <Card.Title > {title = products[0].name}</Card.Title>
                <Card.Text>
                    <p>Stock: {title = products[0].stock}</p>
                    <p>Precio: {title = products[0].price}</p>
                </Card.Text>
                <Button variant="primary">Agregar al carrito</Button>
            </Card.Body>
    </Card>

  ));
};

export default List;
